import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Header({ activeLink = "Dashboard" }) {
  const navigate = useNavigate();

  // Handler for the logout button
  const handleLogout = () => {
    console.log("User logged out. Redirecting to login page.");
    navigate('/login');
  };

  // --- START: Added code ---
  // This function will be called when the profile button is clicked.
  const handleProfileClick = () => {
    console.log("Navigating to profile page.");
    navigate('/profile'); // Navigate to the profile route.
  };
  // --- END: Added code ---

  return (
    <div style={styles.dashboardHeader}>
      <div style={styles.headerContent}>
        <div style={styles.headerLeft}>
          <div style={styles.logoContainer}>
            <div style={styles.logo}>
              <svg
                style={styles.logoIcon}
                fill="currentColor"
                viewBox="0 0 24 24"
              >
                <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z" />
              </svg>
            </div>
            <span style={styles.logoText}>SAHYatri Dashboard</span>
          </div>
          <nav style={styles.navigation}>
             {/* Navigation links */}
             <Link to="/services" style={styles.navLink}>Dashboard</Link>
             <Link to="/tourists" style={styles.navLink}>Tourists</Link>
             <Link to="/incidents" style={styles.navLink}>Incidents & Alerts</Link>
             <Link to="/reports-analytics" style={styles.navLink}>Reports & Analytics</Link>
             <Link to="/settings-admin" style={styles.navLink}>Settings & Admin</Link>
             <Link to="/help-support" style={styles.navLink}>Help & Support</Link>
             <Link to="/map-geo-fencing" style={styles.navLink}>Map & Geo-fencing</Link>
          </nav>
        </div>

        <div style={styles.headerRight}>
          <button style={styles.userButton}>
            <svg
              style={styles.userIcon}
              fill="currentColor"
              viewBox="0 0 20 20"
            >
              <path
                fillRule="evenodd"
                d="M7 2a1 1 0 011 1v1h3a1 1 0 110 2H9.578a18.87 18.87 0 01-1.724-4.78C7.397 1.09 7.817 1 8.28 1h3.44a1 1 0 110 2H9V3a1 1 0 01-1-1zm4 8a1 1 0 01-1 1H8a1 1 0 01-1-1V8a1 1 0 011-1h2a1 1 0 011 1v1zm-3 0V9h2v1H8zm0 2v1h2v-1H8z"
                clipRule="evenodd"
              />
            </svg>
            English
          </button>
          {/* --- START: Modified line --- */}
          <button style={styles.userButton} onClick={handleProfileClick}>
          {/* --- END: Modified line --- */}
            <svg
              style={styles.userIcon}
              fill="currentColor"
              viewBox="0 0 20 20"
            >
              <path
                fillRule="evenodd"
                d="M10 9a3 3 0 100-6 3 3 0 000 6zm-7 9a7 7 0 1114 0H3z"
                clipRule="evenodd"
              />
            </svg>
            Profile
          </button>
          <button style={styles.userButtonLogout} onClick={handleLogout}>
            <svg
              style={styles.userIcon}
              fill="currentColor"
              viewBox="0 0 20 20"
            >
              <path
                fillRule="evenodd"
                d="M3 3a1 1 0 00-1 1v12a1 1 0 102 0V4a1 1 0 00-1-1zm10.293 9.293a1 1 0 001.414 1.414l3-3a1 1 0 000-1.414l-3-3a1 1 0 10-1.414 1.414L14.586 9H7a1 1 0 100 2h7.586l-1.293 1.293z"
                clipRule="evenodd"
              />
            </svg>
            Logout
          </button>
        </div>
      </div>
    </div>
  );
}

// Styles for Header (no changes here)
const styles = {
  dashboardHeader: {
    backgroundColor: '#003366',
    color: 'white',
    padding: '10px 0',
    boxShadow: '0 2px 5px rgba(0,0,0,0.2)',
  },
  headerContent: {
    maxWidth: '1400px',
    margin: '0 auto',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    padding: '0 15px',
  },
  headerLeft: {
    display: 'flex',
    alignItems: 'center',
    gap: '0.5px',
  },
  logoContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
  },
  logo: {
    backgroundColor: '#007bff',
    borderRadius: '50%',
    padding: '8px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    boxShadow: '0 0 5px rgba(255, 255, 255, 0.3)',
  },
  logoIcon: {
    width: '24px',
    height: '24px',
    color: 'white',
  },
  logoText: {
    fontSize: '1.5em',
    fontWeight: '700',
    color: 'white',
    letterSpacing: '0.5px',
  },
  navigation: {
    display: 'flex',
    gap: '10px',
  },
  navLink: {
    color: '#e9ecef',
    textDecoration: 'none',
    fontSize: '0.85em',
    fontWeight: '500',
    padding: '8px 8px',
    borderRadius: '5px',
    transition: 'background-color 0.3s ease, color 0.3s ease',
    textDecoration:'underline',
  },
  headerRight: {
    display: 'flex',
    alignItems: 'center',
    gap: '15px',
  },
  userButton: {
    backgroundColor: 'transparent',
    border: '1px solid #e9ecef',
    color: '#e9ecef',
    padding: '8px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '0.9em',
    display: 'flex',
    alignItems: 'center',
    gap: '8px',
    transition: 'background-color 0.3s ease, color 0.3s ease, border-color 0.3s ease',
  },
  userIcon: {
    width: '18px',
    height: '18px',
  },
  userButtonLogout: {
    backgroundColor: '#dc3545',
    border: 'none',
    color: 'white',
    padding: '8px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '0.9em',
    display: 'flex',
    alignItems: 'center',
    gap: '8px',
    transition: 'background-color 0.3s ease',
  },
};

export default Header;
